import React from 'react'
import { useState } from 'react/cjs/react.development'
import style from 'styled-components'

function Input(props) {
    const Button = styled.button`
     background: none;
    padding: 10px;
    width: 100px;
    border-radius: 5px;
    border:2px solid #b4b5b9;
    color:grey;
    &:hover{
        cursor: pointer;
    }
`;
